import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import SignUp from "../../components/UserSignUp";

import LoginGoogle from "../../components/GoogleLogin";
import { signupForm } from "../../services/restaurants";

const RestSignup = () => {
  const handleSubmit = (data) => {
    signupForm(data);
  };
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
      }}
    >
      <h1 className="header-rest">A comer!</h1>
      <h3>Regístra tu restaurante o puesto de comida</h3>
      <div>
        <p
          style={{
            fontFamily: "GothamBook",
            fontSize: "14px",
            marginBottom: "0",
          }}
        >
          Si ya registraste tu restaurante
        </p>
        <a
          href="/register"
          style={{
            fontFamily: "GothamBold",
            fontSize: "14px",
            color: "#2FB423",
            textDecorationLine: "underline",
          }}
        >
          Inicia Sesión
        </a>
      </div>

      <LoginGoogle />
      <SignUp handleSubmit={handleSubmit} />
    </div>
  );
};

export default RestSignup;
